// 1576143863
// 1576145006976
function CheckTimeOut(timeOut) {

    console.log("timeout", new Date(Date.now()))
    let current_timestamp = Date.now()
    timeOut = parseInt(timeOut) * 1000
    console.log("timeout", new Date(timeOut))
    if (timeOut === 0) {
        return false
    }
    if (current_timestamp > timeOut) {
        return true
    }
    return false
}


export { CheckTimeOut }
